import React, { useContext } from 'react';
import { ContextGlobal } from '../Components/utils/global.context'; // Ajusta la ruta según tu estructura de carpetas
import Card from '../Components/Card';

const Home = () => {
  const { dentists, loading } = useContext(ContextGlobal);

  if (loading) {
    return <p>Cargando...</p>;
  }

  if (dentists.length === 0) {
    return <p>No se encontraron usuarios.</p>;
  }

  return (
    <div className="home-container">
      <h1>Lista de Dentistas</h1>
      <div className="card-container">
        {dentists.map(dentist => (
          <Card
            key={dentist.id}
            id={dentist.id}
            name={dentist.name}
            username={dentist.username}
            isFav={false} 
          />
        ))}
      </div>
    </div>
  );
};

export default Home;
